import "./navbar.css"
import Logo from "../assets/image/logo.png"
export default function Navbar() {
    return (
        <nav >
        <div className="top">
            <div className="topLeft">
            <img src={Logo} alt="logo" width="80px" height="50px" style={{marginleft:"50px"}} />
            </div>
        </div>
        </nav>
    )
}
